import React, { Component } from 'react';
import pageOne from './images/pg1.jpg';

class SmallCardPanel extends Component {
	render () {
		return (
			<div>
				<h1 className="display-1 text-center">Small Card Panel</h1>
				<img src={pageOne} />
			</div>
		);
	}
}

export default SmallCardPanel;
